import React from "react";

const Card = (props) => {
  return (
    <div className="tc bg-light-green dib br3 pa3 ma2 grow bw2 shadow">
      <img
        src="https://robohash.org/${props.id}?200x200"
        alt="Robot pics here"
      />
      <div>
        <h2>{props.name}</h2>
        <p>{props.email}</p>
        <p>{`id number is: ${props.id}`}</p>
      </div>
    </div>
  );
};

export default Card;
